import React, {Component} from "react";
import {Link} from "react-router-dom";

export default class InstrumentTableRow extends Component {    
        render() {
            console.log("InstrumentTable received props:", this.props.instruments); // Debugging

            return (
                this.props.instruments && this.props.instruments.length > 0 ? (
                    <table>
                        <thead>
                            <tr>
                                <th>Type</th>
                                <th>Colour</th>
                                <th>Year</th>
                                <th>Price</th>
                                <th> </th>
                            </tr>
                        </thead>
                        <tbody>
                            {this.props.instruments.map((instrument) => (
                                <InstrumentTableRow key={instrument._id} instruments={instrument} />
                            ))}
                        </tbody>
                    </table>
                ) : <p>No instruments available.</p>
            );
        }

    }
